import React, { Component } from 'react';
import s from './Video.module.css';
import playIcon from '../img/playIcon.png';

class Video extends Component {

    render() {
        return (
            <div className={s.video}>
                <div id={s.videoContainer}>
                    <div id={s.videoWrapper}>
                        <video src="https://production.cdmycdn.com/assets/marketing-pages/intensives/bws/coding-scenes-9a2031e8142b40bdb5d936d5eef33dfa.mp4"
                            autoplay="autoplay"
                            loop="loop"
                            muted="muted">
                        </video>
                        <div id={s.videoOverlay}></div>
                        <div id={s.playIcon}>
                            <img src={playIcon} alt="play icon"/>
                        </div>
                    </div>
                        {/* <div id={s.videoOverlay}></div>
                        <div id={s.playIcon}>
                            <img src={playIcon} alt="play icon"/>
                        </div> */}
                    
                </div>
            </div>
        )

    }
}

export default Video;
